import React from 'react'
import './App.css';

export const JobPost = () => {
    const skills=["JavaScript","HTML","ReactJS"];
  return (
    <div className='jobpost'>
    <div className='posts'>
        <h4>Front-End Developer-Amazon</h4>
        <p>Temporary</p>
        <div className='skillist'>
           {skills.map((skill)=>(
            <p className='post' key={skill}>{skill}</p>
            ))}
        </div>
        <button className='apply'>Apply</button>
    </div>
    </div>

  )
}
